import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from "axios";

// components

function App() {

  const getApi = () => {
     axios
    .get("/api/")
    .then((res) => this.setState({ todoList: res.data }))
    .catch((err) => console.log(err))
  }

  return (
    <div className="App">
      <h1>app.js</h1>
      {console.log(getApi)}
    </div>
  );
}

export default App;
